import React from 'react';

const Facture = () => {
    return (
        <div className='page'>
            <main>
                <header>
                    <div>
                        <h2>Invoicer</h2>
                    </div>
                    <div>
                        <ul>
                            <li>Print</li>
                            <li>Download</li>
                            <li>Send</li>
                        </ul>
                    </div>
                </header>
                
            </main>
        </div>
    );
};

export default Facture;
